import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";

const Header = (props, postSignout) => {
  console.log("cek props logout", props.isLogin);
  postSignout = async () => {
    console.log("cek masuk logout");
    await props.doLogout();
    const isLogin = props.logout;
    console.log("cek islogin", isLogin);
    if (!isLogin) {
      props.history.push("/signin");
    }
  };

  return (
    <div>
      <nav
        className="navbar navbar-expand-lg navbar-light bg-dark"
        style={{
          backgroundColor: "AliceBlue",
        }}
      >
        <Link>
          <img
            src={require("../media/logo192.png")}
            className="navbar-brand App-logo"
            style={{ width: "40px", height: "50px" }}
          />
        </Link>
        <Link>
          <h2 style={{ color: "aqua" }}>Movie</h2>
        </Link>

        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div
          style={{
            fontWeight: "bolder",
          }}
          className="collapse navbar-collapse"
          id="navbarSupportedContent"
        >
          <ul className="navbar-nav mr-auto">
            <li className="nav-item ">
              <Link className="nav-link" to="/" style={{ color: "white" }}>
                {" "}
                Home <span className="sr-only">(current)</span>
              </Link>
            </li>
            <li className="nav-item">
              <Link
                className="nav-link"
                to="/profile"
                style={{ color: "white" }}
              >
                {" "}
                Profile <span className="sr-only">(current)</span>
              </Link>
            </li>
            <li className="nav-item">
              {props.isLogin ? (
                <Link
                  className="nav-link"
                  onClick={() => props.postSignout()}
                  style={{ color: "white" }}
                >
                  Logout <span className="sr-only">(current)</span>
                </Link>
              ) : (
                <Link
                  className="nav-link"
                  to="/signin"
                  style={{ color: "white" }}
                >
                  Login <span className="sr-only">(current)</span>
                </Link>
              )}
            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
};

export default Header;
